from datetime import datetime
from typing import List, Dict, Any, Optional

class User:
    def __init__(self, user_id: int, user_type: str):
        self.user_id = user_id
        self.user_type = user_type

class Submission:
    def __init__(self, submission_id: int, user_id: int, publish_status: str):
        self.submission_id = submission_id
        self.user_id = user_id
        self.publish_status = publish_status
        self.last_updated = datetime.now()
        self.errors: List[str] = []

    def update_publish_status(self, new_status: str):
        self.publish_status = new_status
        self.last_updated = datetime.now()

class ValidationRule:
    def __init__(self, rule_id: int, description: str):
        self.rule_id = rule_id
        self.description = description

class FABS:
    submissions: List[Submission] = []
    validation_rules: List[ValidationRule] = []

    @classmethod
    def upload_submission(cls, user: User, submission: Submission):
        cls.submissions.append(submission)
        print(f"Submission {submission.submission_id} uploaded by user {user.user_id}.")

    @classmethod
    def validate_submission(cls, submission: Submission):
        # Simple validation logic
        if submission.publish_status not in ['pending', 'published', 'failed']:
            submission.errors.append("Invalid publish status.")
        if not submission.errors:
            print(f"Submission {submission.submission_id} is valid.")
        else:
            print(f"Submission {submission.submission_id} has errors: {submission.errors}")

    @classmethod
    def update_validation_rules(cls, rule: ValidationRule):
        cls.validation_rules.append(rule)
        print(f"Validation rule {rule.rule_id} added.")

    @classmethod
    def get_submissions(cls) -> List[Dict[str, Any]]:
        return [{'submission_id': s.submission_id, 'user_id': s.user_id, 'status': s.publish_status} for s in cls.submissions]

class AgencyUser(User):
    def include_flexfields(self, data: Dict[str, Any]):
        # Logic to include flexfields
        print(f"Agency user {self.user_id} is including flexfields: {data}")

class UIUser(User):
    def design_resources_page(self):
        print(f"UI designer {self.user_id} is redesigning the Resources page.")

    def report_user_testing(self):
        print(f"UI designer {self.user_id} is reporting user testing results.")

class Developer(User):
    def log_issue(self, issue: str):
        print(f"Developer {self.user_id} logged an issue: {issue}")

    def prevent_double_publish(self):
        print(f"Developer {self.user_id} implemented logic to prevent double publishing.")

class DataUser(User):
    def receive_updates(self):
        print(f"Data user {self.user_id} is receiving updates to FABS records.")

class Owner(User):
    def create_user_testing_summary(self):
        print(f"Owner {self.user_id} created a user testing summary.")

# Example usage
user1 = AgencyUser(user_id=1, user_type='agency')
submission1 = Submission(submission_id=101, user_id=user1.user_id, publish_status='pending')
FABS.upload_submission(user1, submission1)
FABS.validate_submission(submission1)

user2 = UIUser(user_id=2, user_type='ui_designer')
user2.design_resources_page()
user2.report_user_testing()

user3 = Developer(user_id=3, user_type='developer')
user3.log_issue("Issue with submission validation.")
user3.prevent_double_publish()

user4 = DataUser(user_id=4, user_type='data_user')
user4.receive_updates()

user5 = Owner(user_id=5, user_type='owner')
user5.create_user_testing_summary()

# Display current submissions
print(FABS.get_submissions())
